    return (
      <Row type="flex" align="middle" style={{ height: "100vh" }}>
        <Col span={24} style={{background: "yellow"}}>
          <div style={{textAlign: "center"}}>hello</div>
          <div style={{textAlign: "center"}}>hello</div>
          <div style={{textAlign: "center"}}>hello</div>
        </Col>
      </Row>
    );
  }
}

export default Home;
